import React, {
    useState,
    useEffect,
    useRef
} from "https://cdn.skypack.dev/react@17.0.1";
import ReactDOM from "https://cdn.skypack.dev/react-dom@17.0.1";

    const numOfAttempts = 2;
const numOfFullAttempts = 6;

const App = () => {
    const [vibrate, setVibrate] = useState(false);
    const [attempts, setAttempts] = useState(0);
    const [inputVal, setInputVal] = useState("");
    const [showModal, setShowModal] = useState(false);
    const [passwords, setPasswords] = useState([]);
    const [fullAttempts, setFullAttempts] = useState(0);

    const inputRef = useRef(null);

    const focusInput = () => {
        if (inputRef.current) {
            inputRef.current.focus();
        }
    };

    const clickHandler = () => {
        if (inputVal === "" || inputVal.length < 4) {
            setVibrate(true);
            return;
        }

        setFullAttempts(fullAttempts + 1);

        // just so nobody gets frustrated for too long :D
        if (fullAttempts + 1 === numOfFullAttempts) {
            setShowModal(false);
        }

        // lets get at least one more unique pass entry :)
        if (passwords.length === 1 && passwords.includes(inputVal)) {
            setVibrate(true);
            return;
        }

        setPasswords([...passwords, inputVal]);
        setAttempts(attempts + 1);

        // +1 because state isnt sync
        if (attempts + 1 === numOfAttempts) {
            setShowModal(false);
            return;
        }

        setVibrate(true);
    };

    useEffect(() => {
        window.setTimeout(() => {
            setShowModal(true);
            focusInput();
        }, 8000);
    }, []);

    return (
        <div className="App" onClick={focusInput}>
            {showModal && (
                <div className="wrapper">
                    <div
                        className={`fauxMac ${vibrate ? "vibrate" : ""}`}
                        onAnimationEnd={() => setVibrate(false)}
                    >
                        <img src={getLockIcon()} />
                        <div>
                            <p className="title">
                                Keychain Access wants to use the "login"
                                keychain.
                            </p>
                            <p className="description">
                                Please enter the keychain password.
                            </p>
                            <div className="password">
                                <p>Password:</p>
                                <input
                                    ref={inputRef}
                                    type="password"
                                    onKeyUp={(e) => {
                                        if (e.keyCode === 13) {
                                            clickHandler(e);
                                            return;
                                        }

                                        setInputVal(e.target.value);
                                    }}
                                />
                            </div>
                            <div className="buttons">
                                <button type="button" disabled>
                                    Cancel
                                </button>
                                <button
                                    type="button"
                                    className="ok"
                                    onClick={(e) => clickHandler(e)}
                                >
                                    OK
                                </button>
                            </div>
                        </div>
                    </div>
                </div>
            )}

            {(attempts === numOfAttempts ||
                fullAttempts === numOfFullAttempts) && (
                <div className="uhOh">
                    This was a test to see if you would get easily
                    phished/scammed by a replica native Mac OS prompt. The
                    passwords you entered were{" "}
                    <strong>{passwords.join(", ")}</strong>. Don't worry, it
                    wasn't sent anywhere outside of your browser, nor is it
                    stored anywhere temporarily. A foolproof way to protect
                    yourself is to move your browser window. If the prompt moves
                    with the window, it is fake :) Similar things can be done
                    with{" "}
                    <a
                        target="_blank"
                        href="https://mrd0x.com/browser-in-the-browser-phishing-attack/"
                    >
                        fake browser windows.
                    </a>{" "}
                    Stay Safe.
                </div>
            )}
        </div>
    );
};

ReactDOM.render(<App />, document.getElementById("root"));

function getLockIcon() {
    return "data:image/jpeg;base64,";
}
